# Durasovo, Chishminsky District, Republic of Bashkortostan

}}
Durasovo () is a rural locality (a selo) and the administrative centre of Durasovsky Selsoviet, Chishminsky District, Bashkortostan, Russia. The population was 368 as of 2010. There are 7 streets.
Geography
Durasovo is located 23&nbsp;km south of Chishmy, the administrative centre of the district. Verkhnekhozyaystvo is the nearest rural locality.
